const el=(n,o=document)=>o.querySelectorAll(n),[elParagraph]=el(".paragraph"),[elStyle]=el("#style"),sourceText='/* 大家好! 👋\n * 我是京东物流-技术发展部-中台技术部-技术平台组的JD star 🚀\n * 武林秀\n * 接下来我给大家画一个快递小鸽\n * 首先准备一个背景 */\n.figure {\n  position: relative;\n  height: 50vh;\n  background: #62656c;\n}\n/* 画一个圈圈 🌑 */\n.head {\n  position: absolute;\n  top: 50%;\n  left: 50%;\n  width: 100px;\n  height: 100px;\n  background: #7c8499;\n  border: 4px solid #000;\n  border-radius: 50%;\n  transform: translate(-50%, -50%);\n}\n/* 给小鸽画个帽子 🧢 */\n.capWrapper {\n  position: absolute;\n  top: -5%;\n  left: 50%;\n  width: 45px;\n  height: 25px;\n  background: #e23232;\n  border: 4px solid #000;\n  border-radius: 30px 30px 10px 10px;\n  transform: translate(-50%, -50%);\n\n}\n/* 帽子上有个尖尖 ✐ */\n.capU {\n  position: absolute;\n  top: -36%;\n  left: 50%;\n  width: 3px;\n  height: 6px;\n  background: #000;\n  border-radius: 50%;\n  transform: translateX(-50%);\n}\n/* 左边画一瓣 👈 */\n.capL {\n  position: absolute;\n  bottom: -5%;\n  left: 20%;\n  width: 40px;\n  height: 22px;\n  background: transparent;\n  border: 4px solid #000;\n  border-top: none;\n  border-right: none;\n  border-bottom: none;\n  border-radius: 20px 0 0 0;\n}\n/* 右边画一瓣 👉 */\n.capR {\n  position: absolute;\n  bottom: -5%;\n  right: 20%;\n  width: 40px;\n  height: 22px;\n  background: transparent;\n  border: 4px solid #000;\n  border-top: none;\n  border-left: none;\n  border-bottom: none;\n  border-radius: 0 20px 0 0;\n}\n/* 还有一个帽檐儿 🤠*/\n.capD {\n  position: absolute;\n  bottom: -20%;\n  left: -40%;\n  width: 15px;\n  height: 5px;\n  background: #000;\n  border-radius: 50% 0 0 50%;\n  transform: rotate(-5deg);\n}\n/* 接着画小鸽的眼睛 👀 */\n.eyeL {\n  position: absolute;\n  top: 30%;\n  left: 20%;\n  width: 8px;\n  height: 8px;\n  background: #000;\n  border-radius: 50%;\n}\n/* 眯起来 😄 */\n.eyeR1 {\n  position: absolute;\n  top: 31%;\n  left: 38%;\n  width: 10px;\n  height: 3px;\n  background: #000;\n  border-radius: 4px;\n  transform: rotate(-30deg);\n}\n.eyeR2 {\n  position: absolute;\n  top: 34.5%;\n  left: 38%;\n  display: block;\n  width: 10px;\n  height: 3px;\n  content: "";\n  background: #000;\n  border-radius: 4px;\n  transform: rotate(20deg);\n}\n/* 小小的眉毛 😊 */\n.eyeLup {\n  position: absolute;\n  top: 23%;\n  left: 23%;\n  width: 7px;\n  height: 3px;\n  background: #000;\n  border-radius: 4px;\n  transform: rotate(30deg);\n}\n.eyeRup {\n  position: absolute;\n  top: 23%;\n  left: 38%;\n  width: 7px;\n  height: 3px;\n  background: #000;\n  border-radius: 4px;\n  transform: rotate(-30deg);\n}\n/* 然后画小鸽的嘴巴 👄 */\n.mouthU {\n  position: absolute;\n  top: 40%;\n  left: 18%;\n  width: 30px;\n  height: 10px;\n  background: #ffa2a6;\n  border: 4px solid #000;\n  border-radius: 50%/100% 100% 0 0;\n  border-bottom: none;\n}\n.mouthM {\n  position: absolute;\n  top: 37%;\n  left: 19.5%;\n  z-index: 1;\n  width: 27px;\n  height: 20px;\n  background: transparent;\n  border: 4px solid #000;\n  border-radius: 15px/11px;\n  border-top: none;\n  border-left: none;\n  border-right: none;\n}\n.mouthD {\n  position: absolute;\n  top: 50%;\n  left: 18%;\n  z-index: -1;\n  width: 30px;\n  height: 20px;\n  background: #ffa2a6;\n  border: 4px solid #000;\n  border-radius: 50%/0 0 100% 100%;\n  border-top: none;\n}\n/* 点两个鼻孔 👃 */\n.mouthM::before {\n  position: absolute;\n  top: 50%;\n  left: 35%;\n  display: block;\n  width: 3px;\n  height: 3px;\n  content: "";\n  background: #000;\n  border-radius: 50%;\n}\n.mouthM::after {\n  position: absolute;\n  top: 50%;\n  left: 55%;\n  display: block;\n  width: 3px;\n  height: 3px;\n  content: "";\n  background: #000;\n  border-radius: 50%;\n}\n/* 优雅又不失俏皮的舌头 🤪 */\n.tough {\n  position: absolute;\n  bottom: -5%;\n  right: 10%;\n  width: 8px;\n  height: 6px;\n  background: #e23232;\n  border: 2px solid #000;\n  border-radius: 80% 50% /100% 100% 0 0;\n}\n.tough::before {\n  position: absolute;\n  top: 50%;\n  left: 40%;\n  display: block;\n  width: 2px;\n  height: 4px;\n  content: "";\n  background: #000;\n  border-radius: 50%;\n}\n/* 么么哒 💖*/\n.heartWrapper{\n  position: absolute;\n  top: 30%;\n  right: 20%;\n  transform: rotate(20deg);\n  /* border: 1px solid #000; */\n}\n.heart {\n  width: 8px;\n  height: 8px;\n  background: #ffa2a6;\n  border: 2px solid #000;\n  border-top: none;\n  border-right: none;\n  transform: rotate(-45deg);\n}\n.heartL {\n  position: absolute;\n  top: -50%;\n  left: -45%;\n  width: 8px;\n  height: 9px;\n  background: #ffa2a6;\n  border: 2px solid #000;\n  border-radius: 50% 50% 0 0;\n  border-bottom: 2px solid #ffa2a6;\n  transform: rotate(-45deg);\n}\n.heartM {\n  position: absolute;\n  top: -18%;\n  left: 50%;\n  width: 2px;\n  height: 2px;\n  background: #000;\n  transform: translate(-50%) rotate(45deg);\n}\n.heartR {\n  position: absolute;\n  top: -50%;\n  right: -45%;\n  width: 8px;\n  height: 9px;\n  background: #ffa2a6;\n  border: 2px solid #000;\n  border-radius: 50% 50% 0 0;\n  border-bottom: 2px solid #ffa2a6;\n  transform: rotate(45deg);\n}\n/* 一幅快递小鸽送给大家~\n * 我是京东物流-技术发展部-中台技术部-技术平台组的\n * 武林秀\n * 以梦为码，不负韶华\n * 祝大家1024快乐 👍 */\n ';let paragraphText="",index=0;const step=()=>{setTimeout((()=>{index<sourceText.length&&("\n"===sourceText[index]?paragraphText+="<br>":" "===sourceText[index]?paragraphText+="&nbsp;":paragraphText+=sourceText[index],elParagraph.innerHTML=paragraphText,window.scroll({top:9999,behavior:"smooth"}),elParagraph.scroll({top:9999,behavior:"smooth"}),elStyle.innerHTML=sourceText.slice(0,index),index+=1,step())}),10)};step();
